"use strict";
// Vamos realizar una operacion
// Deberemos declarar una variable que amacenes los tipos de datos, en este caso númericos.
// Posteriormente deberemos indicarle que debe realizar en este caso una multiplicación.
var numero1 = 5;
var numero2 = 6;
var multiplicacion = function (a, b) { return (a * b); };
// Para finalizar mostraremos el resultado por consola, indicando la variable y los valores que contiene,
// en este caso los valores estaban almacenado en variables.
console.log("El resultado es", multiplicacion(numero1, numero2));
